import React  from 'react'
import {useSelector} from 'react-redux'
import { useState, useEffect } from 'react'

const LakeShowPage = () => {
    const lake = useSelector(state=>state.lakeReducer.currentLake)
    const refresh = {}
    useEffect(()=>{
        refresh = lake
        
    })
    return(
        <div>
            <h1>{lake.name}</h1>
        </div>
    )
}
export default LakeShowPage
